import React from 'react';
import SideVideo from './SideVideo'; // make sure you have this component or import it correctly

function VideoPlaylist(props) {
    const { videos, onVideoClick } = props;

    return (
        <section className="side-video__section">
            <h4 className="side-video__section__title">NEXT VIDEO</h4>
            <ul className="side-video__list">
                {videos.map((video, index) => (
                    <li key={index} onClick={() => onVideoClick(video)}>
                        <SideVideo video={video} />
                    </li>
                ))}
            </ul>
        </section>
    );
}

export default VideoPlaylist;
